package com.adn.controlador;

public class AvanceActividades {

	public AvanceActividades() {
		// TODO Auto-generated constructor stub
	}

	private int idAvanceActividad;
	private int idActividad;
	private String mes;
	private String programado;
	private String real;
	
	public int getIdAvanceActividad() {
		return idAvanceActividad;
	}
	public void setIdAvanceActividad(int idAvanceActividad) {
		this.idAvanceActividad = idAvanceActividad;
	}
	public int getIdActividad() {
		return idActividad;
	}
	public void setIdActividad(int idActividad) {
		this.idActividad = idActividad;
	}
	public String getMes() {
		return mes;
	}
	public void setMes(String mes) {
		this.mes = mes;
	}
	public String getProgramado() {
		return programado;
	}
	public void setProgramado(String programado) {
		this.programado = programado;
	}
	public String getReal() {
		return real;
	}
	public void setReal(String real) {
		this.real = real;
	}
	
	
}
